import styled from 'styled-components';


export const Container = styled.div`
    width: 80px;
    height: 80px;
    background-color: #AAE09A;
    border-radius: 20px; 
    display: flex;
    justify-content: center;
    align-items: center;
    margin-left: 10px;
`;

export const CategoryImage = styled.img`
    width: 50px;
    height: 50px;

`;
